    $query.Info()
    $query.Example()
    $query.GqlRequest($false)
    $query.ToString()
    $query.Var.Info()
    $query.Var.Example()
    $query.Var.ToString()

    # Test that a given GraphQL field only shows up once in all commands
    $gqlField = $query.OpInfo().GqlRootFieldName
    # Check if it is already a key in the Hashtable
